import {Table} from "reactstrap";


const ListRecipes = (props) => {
    const {recipes} = props
    return(
        <Table dark>
            <thead>
            <tr>
                <th>Title</th>
                <th>Text</th>
                <th>Category</th>
            </tr>
            </thead>
            <tbody>
            {recipes.map(recipe => (
                    <tr key={recipe.pk}>
                        <td>{recipe.title}</td>
                        <td>{recipe.text}</td>
                        <td>{recipe.category.title}</td>
                    </tr>
                )
            )}
            </tbody>
        </Table>
    )
}

export default ListRecipes;
